import React, {Component} from 'react';

import './product.css';
import { axiosService } from '../../service/axios';

class Product extends Component {
    constructor(props) {
        super();
        this.state = {
            products:[]
        }
        this.loadProducts = this.loadProducts.bind(this);
        this.loadMktProducts = this.loadMktProducts.bind(this);
    }

    componentDidMount() {
       this.loadProducts();
       this.loadMktProducts();
    }

    async loadProducts() {
        try {
            const response = await axiosService({
                url: '/product/find',
                method:'GET',
                params: {idProduct: '', page: 0, size: '0', sort: '', sortDirection: ''}
            })
            console.log(response)
        } catch (error) {
            console.log(error.message);
        }
    }

    async loadMktProducts(){
        try {
            const response = await axiosService({
                url: '/marketProduct/find', method:'GET',
                params: {idProduct: '1', page: 0, size: '10', sort: '', sortDirection: ''}
            })
            console.log(response)
        } catch (error) {
            console.log(error.message);
        }
    }

    render(){
        return(
            <div id='containerProducts'>
                <h1>Produtos</h1>
            </div>
        )
    }
}
export default Product;
